import React from "react";
import "./Footer.css"
function Footer(){
    const messageOnFooter="This is the Footer!";
    const date=new Date()
    return(

        <div>
            <h1 className="foot">{messageOnFooter+":"+date.getHour()}</h1>
        </div>
    )
}

export default Footer;
